import { Todo } from '../../model';

interface Props {
    todos: Todo[],
    settodos:  React.Dispatch<React.SetStateAction<Todo[]>>
}

const TodoList:React.FC<Props>= ({todos,settodos}) => {
  
  return (
    <div>
    <h2>Todo List:</h2>
      {todos.map((item) => 
        item.todo=== "" ?( <noscript></noscript>): (<li key={item.id}>{item.todo}</li>))
      }
    </div>
  );
}

export default TodoList;
